import * as React from "react";
import { useEffect, useState } from "react";

import { Button } from "react-bootstrap";
import { Link } from "react-router-dom";
import { closeModal } from "../../../defultComponent/funPublik";

const View = (props) => {
    console.log("props111111", props)
    return (
        <>
            <button id="myBtn" >
                <img src="https://img.icons8.com/ios-glyphs/30/ab5e2a/visible--v1.png" />
            </button>
        </>
    )
}

const Price = (priceAll) => {
    if (priceAll.priceAll) {
        return (
            <div>
                {priceAll.priceAll + "₪"}
            </div>
        )
    }
    else {
        return (
            "------"
        )
    }
}

const Status = (queue) => {
    if (queue === "tobesited") {
        return (
            "ממתין לשולחן"
        )
    }
    if (queue === "sit") {
        return (
            "ממתין לשירות"
        )
    }
    if (queue === "awaitingbill") {
        return (
            "ממתין לחשבון"
        )
    }
}

const MapResevation = (reservation) => {
    reservation = JSON.parse(...reservation)
    const object = { a: 1, b: 2, c: 3 };
    console.log("reservation", typeof (reservation), typeof (object))

    for (const property in reservation) {
        console.log(`${property}: ${reservation[property]}`);
    }
    return (
        <menu className="table table-dark" >
            <thead>
                <tr >
                    <th>id</th>
                    <th>שם מנה</th>
                    <th>קטגוריה</th>
                    <th>מחיר</th>
                </tr>
            </thead>
            <tbody>
                {reservation.map((item, i) => {
                    return (
                        <tr key={i} className="align-items-center">
                            <td>{item.id}</td>
                            <td>{item.name}</td>
                            <td>{item.category}</td>
                            <td>{item.price}</td>
                        </tr>
                    )
                })}
            </tbody>
        </menu>
    )
}

const CustomersView = (props) => {

    let listCustomers = { props }
    console.log("ppppppppppppppp", props)
    return (
        <div id="myModal" class="modal">

            <div class="modal-content">
                <div>
                    <div id="Xclose" >
                        <img src="https://img.icons8.com/ios-glyphs/30/000000/delete-sign.png" />
                    </div>
                </div>
                <div id="propertis">
                    <table >
                        <tr >
                            <td>{listCustomers.id}</td>
                            <th>id</th>
                        </tr>
                        <tr >
                            <td>{listCustomers.name}</td>
                            <th>שם קבוצה</th>
                        </tr>
                        <tr >
                            <td>{listCustomers.size}</td>
                            <th>גודל קבוצה</th>
                        </tr>
                        <tr >
                            <td>{listCustomers.lastUpdated}</td>
                            <th>שעת הגעה</th>
                        </tr>
                        <tr >
                            <td>{listCustomers.table1 ?
                                <Link
                                    to={"/tables/" + listCustomers.table1}
                                    className="px-1"
                                    title="view">
                                    <Button variant="secondary">
                                        {listCustomers.table1}
                                    </Button>
                                </Link> : "מחכים לשולחן"}
                            </td>
                            <th>שולחן</th>
                        </tr>
                        <tr >
                            <td>{Status(listCustomers.queue)}</td>
                            <th>סטטוס</th>
                        </tr>
                        <tr >
                            <td><Price priceAll={listCustomers.sum} /></td>
                            <th>סך לתשלום</th>
                        </tr>
                        <tr >
                            <td>{listCustomers.reservations
                                // ? MapResevation(customer.reservations) : "------"
                            }</td>
                            <th>הזמנות</th>
                        </tr>
                    </table>
                </div>
                <div>
                    <button class="close" onClick={() => closeModal()}>
                        אישור
                    </button>
                </div>
            </div>
        </div>
    )
}
export default CustomersView;
